import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>VRide Carpooling</h3>
        <ul><li>Hello</li></ul>
      </header>
    </div>
  );
}

export default App;
